description:
Buku resipi Senangnya Memasak Kuih Kukus ini menghidangkan 23 resipi kuih kukus dan 7 resipi baru. Ia disertakan dengan gambar langkah demi langkah yang mudah dan praktikal. Resipi-resipi ini disediakan oleh Chef Hanieliza yang berpengalaman luas dalam bidang masakan. Hidangan yang disajikan bukan sahaja lazat, malah mudah dan cepat disediakan.
